import React from "react";

export default function Modal(props) {
  
  return (
    <form>
      <div className="mb-3">
        <img src={props.notes.img} height="200px" width="100%" style={{borderRadius:"8px",marginBottom:"20px"}} className="card-img-top" alt="..." />

        <div style={{fontSize:"20px",fontWeight:"500"}} onChange={props.onchange}>{props.notes.name}</div>

        <p style={{fontSize:"15px",fontWeight:"700"}}>Discreption: </p>
        <div onChange={props.onchange}> {props.notes.title}</div>

        <p style={{fontSize:"15px",fontWeight:"700"}}onChange={props.onchange}></p>
        <div onChange={props.onchange}>Seller-Name: {props.notes.seller}</div>
        <p style={{fontSize:"15px",fontWeight:"700"}}></p>
        <div onChange={props.onchange}>Price: {props.notes.price}</div>
      </div>
    </form>
  );
}
